import React, { useState } from "react";
import axios from "axios";
import { useEffect } from "react";



function Testing() {

    const [data, setData] = useState([]);

    const fetchData = () => {
      fetch(`http://192.168.137.1:8000/?format=json`)
        .then((response) => response.json())
        .then((actualData) => {
          console.log(actualData);
          setData(actualData);
          console.log(data);
        })
        .catch((err) => {
          console.log(err.message);
        });
    };

    useEffect(() => {
      fetchData();
    }, []);

    return (
      <div className="Testing">
        <tbody>
          <tr>
            <th>Name</th>
            <th>Brand</th>
            <th>Image</th>
            <th>Price</th>
            <th>Rating</th>
          </tr>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.user[0].username}</td>
              <td>{item.brand}</td>
              <td>
                <img src={item.thumbnail} alt="" height={100} />
              </td>
              <td>{item.price}</td>
              <td>{item.rating}</td>
            </tr>
          ))}
        </tbody>
      </div>
    );
}

export default Testing;
